export interface ICardImages
{
    image_url?: string,
    image_url_small?: string
}

export interface ICardPrices
{
    amazon_price: string,
    cardmarket_price?: string,
    ebay_price?: string,
    tcgplayer_price?: string
}

export interface ICardSets
{
    set_code?: string,
    set_name?: string,
    set_price?: string,
    set_rarity?: string
}

export interface ICardDetails
{
    _id: string,
    archetype?: string,
    atk?: number, 
    attribute?: string,
    card_images: ICardImages[],
    card_prices: ICardPrices[],
    card_sets?: ICardSets[],
    def?: number,
    desc: string,
    id: number,
    level?: number,
    name: string,
    race?: string,
    type?: string
}

export type CardProps = {
    id?: number;
    isAddToBagButtonDisabled?: boolean,
    isFullDescriptionVisible: boolean,
    card?: ICardDetails
}

export const DEFAULT_CARD_VALUE: ICardDetails = {
    _id: '',
    archetype: '',
    atk: 0, 
    attribute: '',
    card_images: [{image_url: 'data:image/jpeg;base64,'}],
    card_prices: [{amazon_price: ' 0 '}],
    card_sets: [],
    def: 0,
    desc: '',
    id: 0,
    level: 0,
    name: '',
    race: '',
    type: ''
}

export const getInitialCardList = (nrOfCardsToShow: number) => {
    const initialCards: ICardDetails[] = [];
    for (let index = 0; index < nrOfCardsToShow; index++) {
        initialCards.push(DEFAULT_CARD_VALUE);
    }
    
    return initialCards;
}

export const getRandomInt = (max: number) => {
    return Math.floor(Math.random() * Math.floor(max));
}